"ခင်ကျော်ညွန့်ခင်ကြည်ခင်ခင်ကြိုင်ခင်ချိုလတ်ခင်ငြိမ်းချမ်းခင်ငြိမ်းငြိမ်းအိခင်စန်းမြင့်ခင်စန်းမူခင်စန်းဝင်းခင်စမ်းမြင့်ခင်စိုးခင်စုစုအေးခင်စောမူခင်စောလွင်ခင်စောဝေခင်ဆွေခင်ဆွေဆွေဝင်းခင်ဇော်ခင်ဇော်ခင်ညွန့်ခင်ဌေးမြင့်ခင်ဌေးမြင့်ခင်ဌေးရင်ခင်တလုံးခင်ထားမြင့်(ခ)ယားမီးသဲခင်နွယ်နွယ်လှိုင်ခင်နွဲ့ခင်နှင်းရီခင်ဖုန်းဝေခင်ဘို(ခ)အောင်ခင်ဗိုလ်ခင်မျိုးချစ်ခင်မျိုးမြင့်ခင်မျိုးလှခင်မျိုးသန့်ခင်မျိုးသွယ်ခင်မြင့်ခင်မြင့်ဆွေခင်မြင့်ဌေးခင်မြင့်ဝေခင်မွန်သန်းခင်မာကြည်ခင်မာချိုခင်မာစန်းခင်မာရီခင်မိုးဝါခင်မေလွင်ခင်မောင်ခင်မောင်ခင်မောင်ခင်မောင်ခင်မောင်ခင်မောင်ခင်မောင်(ခ)ဘူးရယ်ခင်မောင်ကျော်ခင်မောင်ကျော်ခင်မောင်ကြည်ခင်မောင်ကြည်(ခ)ကျော်စိန်ဟန်ခင်မောင်ကြွယ်ခင်မောင်ချိုခင်မောင်စိုးခင်မောင်ဆင့်ခင်မောင်ဆွေခင်မောင်ဇင်ခင်မောင်ဇော်ခင်မောင်ညွန့်ခင်မောင်ညွန့်ခင်မောင်ဌေးခင်မောင်ဌေးခင်မောင်ဌေးခင်မောင်ဌေးခင်မောင်ဌေးခင်မောင်တင့်ခင်မောင်ထွန်းခင်မောင်ထွန်းခင်မောင်ထွန်းခင်မောင်ထွန်းခင်မောင်ထွန်း(နော်အီး)ခင်မောင်ထွေးခင်မောင်ထူးခင်မောင်ထူး(ခ)ကိုကိုခင်မောင်ဖြူခင်မောင်ဖြူ(ဗျားဒူ)ခင်မောင်မြင့်ခင်မောင်မြင့်ခင်မောင်မြင့်ခင်မောင်မြင့်(ခ)ဒိတ်ခင်မောင်ရင်ခင်မောင်ရင်ခင်မောင်ရွှေခင်မောင်ရွှေခင်မောင်လွင်ခင်မောင်လွင်ခင်မောင်လွင်ခင်မောင်လှခင်မောင်လေးခင်မောင်ဝင်းခင်မောင်ဝင်းခင်မောင်ဝင်းခင်မောင်ဝင်းခင်မောင်ဝင်းခင်မောင်ဝင်းခင်မောင်ဝင်းခင်မောင်ဝင်းခင်မောင်သန်းခင်မောင်သန်းခင်မောင်သန်းခင်မောင်သန်းခင်မောင်သိန်းခင်မောင်သောင်းခင်မောင်အေးခင်မောင်အေးခင်မောင်အေးခင်ရီခင်လှရီခင်လေးမြင့်ခင်ဝင်းခင်ဝင်းခင်ဝင်းနု(ခ)ရီရီသန်းခင်သက်နိုင်ခင်သက်မာခင်သန်းနွဲ့ခင်သန်းမောင်ခင်သူဇာမောင်ခင်သူဇာဝင်းခင်အုန်းခင်အုန်းမြင့်ခင်အေးခင်အောင်ခန်းဒါးနော်လာခမ်ဟောက်လျန်ချက်ကြီးချက်ဖားချစ်ချစ်ချစ်ကိုကိုချစ်ခိုင်ချစ်စန်းချစ်တင်ချစ်တင်ချစ်တင်ချစ်နိုင်ချစ်ပုံ့ပုံ့ထွ���းချစ်မင်းချစ်မင်းသိန်းချစ်ယောင်းချစ်ရွှေချစ်ရေချစ်လွင်ချစ်လှချစ်လှိုင်ချစ်သန်းချစ်သိန်းချစ်သောင်းချစ်အောင်ချန်းခေါ်ဆားရ်ချန်းဂျောင်ဆားရ်ချန်တန်ခင်ချမ်းငြိမ်းသူချမ်းငြိမ်းအောင်ချမ်းထက်ကိုချမ်းမြင့်ချမ်းမြေ့ချမ်းမြေ့ဝင်းချမ်းမြေ့အောင်ချမ်းသာချိန်ကြီးချို(ခ)သောင်းတင်ချိုချိုမြင့်ချီမောင်ချော်နေပါးခွထီးယိုးခွန်ကျော့ဖေခွန်ကျော်ထွေးခွန်းကျော်မြင့်ခွန်ကျော်အေးခွန်းကလေးမင်းခွန်ချစ်သန်းခွန်စိန်မောင်ခွန်စောအောင်ခွန်ဇော်ထွေး(ခ)ခွန်မောင်းပေးခွန်တင်မြင့်ခွန်တင်သန်းခွန်ထွန်းခွန်ထွန်းရင်ခွန်ထွန်းလူ(ခ)ဒီကီခွန်ထွန်းဝင်းခွန်ထွေးမောင်(ခ)ခွန်ရွှေမန်းခွန်ဒီဂေါလ်ခွန်မျိုးတင့်ခွန်မောင်ချစ်ခွန်မောင်စိုးခွန်မောင်ပယ်ခွန်မောင်ဖြူခွန်မောင်လွန်းခွန်မောင်ဝင်းခွန်ရန်နိုင်ခွန်ရွှေသင်းခွန်ရဲထွေးခွန်လှဆန်းခွန်လှသိန်းခွန်ဝင်းနောင်ခွန်သန်း(ခ)ခွန်အာကာခွန်သန်းမြင့်ခွန်သီဟခွန်သူရအောင်ခွန်သောင်းကျော်ခွန်ဟန်သိန်းခွန်းအေးမောင်ခွန်အောင်ခင်ခွန်အောင်နိုင်ထွေးခါးထုန်ခိုင်ခိုင်လဲ့ခိုင်ခိုင်ဝင်းခိုင်ငိုက်လန့်ခိုင်စန္ဒာခိုင်ဇင်ခိုင်ညီညီကျော်ခိုင်တင်ဇာအောင်ခိုင်ထွန်းခိုင်ထွန်းလင်းခိုင်ထူးမင်းခိုင်မျိုးကျော်ခိုင်မာဌေးခိုင်ဝင်းခိုင်ဝင်းခီလီဆဲခုပ်ဆန်းထန်ခူးယူဂျင်းခူးရယ်ခေါင်ဇယ်ခေါင်ဇယ်ခေါင်ဇယ်ခေါင်ဇယ်ခေါင်ဇယ်ခေါင်ညွယ်ခေါင်ဒေါင်ခေါင်ဒေါင်(ခ)လဂျောင်ခေါင်ဒေါင်ခေါတိန့်ခေါန်တောင်ခေါန်ဒင်းခေါဘောမ်ခေါသွလာခေါ်မာဝူဂမ်အောင်ဂျက္ကပ်လမ်နပ်ဂျင်မီစိန်ဂျန်မာထွယ်လုဂျယ်ခေါင်ဂျွန်လီဂျာခေါန်ဂျာဆိုင်းခေါန်ဂျာဘောက်ဂျာဘောက်ဂျာလီရဲ့ဂျီလန်းယော်ဂျီလီးဂျုံးလွမ်းဂျေ-ကလက်ဂျေထုရော်ဂျေယော်ရဲ့ဆဲဂျေဟီလော်ဂျော့(ချ်)မျိုးမြင့်ဂွမ်ရိန်ဒီးဂါ့မိုးမြတ်မြတ်သူဂူဆာငင့်ခန့်ထောန်ငယ်ပီးထီယံအုပ်ထန်ငြိမ်းဌေးငြိမ်းမြိုင်ငြိမ်းရွှေငြိမ်းသက်နွယ်ငွန်ဆန်းအောင်ငွါးခီဆာငွါးဆီးဝူငွါးဖီးထွေငွေခိုင်သိန်းငွေစိုးငွေလွင်စံကျော်စကျော်စိန်စံကျော်လှစံကွင်းစည်သူ(ခ)အားတီစည်သူလွင်စံတင်စံထွန်းစံနစ်စနိုးရာစနီအောင်စန္ဒာစန္ဒာမင်းစန္ဒာလင်းစန်းစန်းစန်းကြူစန်းကိုစန်းစန်းနွယ်စန်းစန်းဝင်းစန်းစန်းဝင်းစန်းစန်းဝေစန်းစန်းအေးစန်းစန်းအောင်စန်းဌေးစန်းဌေးစန်းထွေးစန်းပြည့်စန်းမြင့်စန်းမြင့်(ခ)ဆန်းမြင့်စန်းမောင်စန်းမောင်စန်းမောင်စန်းမောင်စန်းမောင်စန်းမောင်စန်းလွင်စန်းလွင်စန်းလွင်စန်းလွင်စန်းဝင်းစန်းဝင်း(ခ)စံဝင်းစန်းဝေစံပြည့်စံပြောင်းစပ္ပါယ်စံမင်းအောင်စံမြင့်စမ်းစမ်းမော်စမ်းစမ်းဝင်းစမ်းသွင်စံရွှင်စံရွှေစံရွှေထွန်းစံရွှေမောင်စံရှိန်စံလင်းအောင်စံလွင်စံဝင်းစံဝင့်ခိုင်စံဝေခေါင်လွမ်းစဝ်ခွန်မိန်းစဝ်စိုင်းစိုင်းနန္ဒာမောင်စဝ်နွဲ့နိုခမ်းစဝ်အောင်မြတ်(ခ)အောင်မြတ်စွဲ့ဆိုင်စသန်းလှစံသာလှစံသိန်းစံသိန်းစံသောင်းစံအောင်မိုးစိန်စိန်ကျော့နုစိန်ကျော်မိုးစိန်ကျော်မိုးစိန်ကြိုင်စိန်ကုလားစိန်ချမ်းနုစိန်ခဲစိန်စိန်စိန်တိုင်းစိန်ထွန်းစိန်ထွန်းစိန်ထွန်းစိန်ထွန်းစိန်ဘိုတင့်စိန်မြင့်စိန်မောင်ဝင်းစိန်ရွှေစိန်လင်းစိန်လင်းစိန်လွင်စိန်လှမိုးစိန်လှိုင်စိန်လှိုင်စိန်လှိုင်(စိန်လှိုင်ဗိုလ်)စိန်ဝင်းစိန်ဝင်းစိန်ဝင်းစိန်ဝင်းစိန်ဝင်းစိန်ဝင်းညွန့်စိန်သောင်းစိန်ဟန်စိန်အောင်မင်းစိမ်းမောင်စိမ်းမောင်စိုးစိုးစိုးကျော်နိုင်စိုးကိုကိုစိုးခိုင်စိုင်းကံစိုင်းကံညွန့်စိုင်းကျောက်စိုင်းကျောက်စိုင်းကျော်စိုင်းကျော်ကျော်စိုင်းကျော်စိုးစိုင်းကျော်ဇေယျ(ခ)စိုင်းယဥ်စိုင်းကျော်ဇောစိုင်းကျော်ထွန်းစိုင်းကျော်မိုးစိုင်းကျော်လှစိုင်းကျော်ဝစိုင်းကျော်ဝင်းစိုင်းကျော်သိန်းစိုင်းကျော်သီဟစိုင်းကျော်အောင်(ခ)စိုင်းမိုးအောင်စိုင်းကြည်ဝင်းစိုင်းကြီးစိုင်းကြူစိုင်းကောင်ခမ်းစိုင်းခင်မောင်ရွှေစိုင်းခမ်းကျန်စိုင်းခမ်းကျော်စိုင်းခမ်းကော်စိုင်းခမ်းချစ်စိုင်းခမ်းခေါင်စိုင်းခမ်းစံစိုင်းခမ်းစင်စိုင်းခမ်းမြတ်စိုင်းခမ်းရွှေစိုင်းခမ်းလူးစိုင်းခမ်းအောင်စိုင်းချစ်ဆွေစိုင်းချစ်မောင်စိုင်းချစ်သိန်းစိုင်းခေးဆိုင်စိုင်းစံညွန့်စိုင်းစံထွန်းစိုင်းစံထွန်းစိုင်းစံဖေစိုင်းစံမိုင်းစိုင်းစမ်(ခ)စိုင်းခွန်မောင်စိုင်းစံဝင်းစိုင်းစွံဆိုင်းစိုင်းစံအေးစိုင်းစံအောင်စိုင်းစိန်လင်းစိုင်းစိန်လူစိုင်းစိန်ဝင်းစိုင်းစိုင်းလုံစိုင်းစိုးတင့်(ခ)စိုင်းခမ်းပန်စိုင်းစိုးထိုက်စိုင်းစိုးမိုးအေးစိုင်းစောလှစိုင်းဆင်စိုင်းဆန်ကွယ်စိုင်းဆန်စိန်စိုင်းဆန်ဆမ်စိုင်းဆန်းမင်းအောင်စိုင်းဆန်းအေးစိုင်းဆမ်တစ်ဖေစိုင်းဆမ်တစ်ယီစိုင်းဆိုင်စိုင်းဆိုင်ထွန်းစိုင်းဆိုင်မွန်းစိုင်းဆိုင်မိန်းစိုင်းဆိုင်လင်းစိုင်းဆိုင်လိန်းစိုင်းဆိုင်ဝမ်းစိုင်းဆိုင်ဝမ်းစိုင်းဆုစိုင်းတင်မိုးအောင်စိုင်းတင်ရွှေစိုင်းတစ်စိုင်းတေဇာဖြူစိုင်းထွန်းစိုင်းထွန်းကြည်စိုင်းထွန်းကြည်စိုင်းထွန်းကိုကိုစိုင်းထွန်းစံ(ခ)စိုင်းဆေဟန်စိုင်းထွန်းဆာစိုင်းထွန်းဉာဏ်စိုင်းထွန်းထွန်းစိုင်းထွန်းထွန်းနိုင်စိုင်းထွန်းထွေး(ခ)စိုင်းနွံလျန်းစိုင်းထွန်းနေနွန်းအောင်စိုင်းထွန်းမြစိုင်းထွန်းရင်စိုင်းထွန်းရွှေ(ခ)စိုင်းဆိုင်လျန်းစိုင်းထွန်းလှစိုင်းထွန်းလှစိုင်းထွန်းဝင်း(ခ)စိုင်းနော်ခမ်းစိုင်းထွန်းဝါစိုင်းထွန်းအေး(ခ)ဝီဘီရန်စိုင်းထွန်းအောင်စိုင်းနွံစိုင်းနွန်းစိုင်းနုစိုင်းနေမျိုးအောင်စိုင်းနေလင်းအောင်စိုင်းနောင့်စိုင်းနော်ခမ်းစိုင်းနော်ခမ်း(ခ)တင်ထွန်းအောင်စိုင်းနော်အောင်စိုင်းပန်စိုင်းပန်ဖစိုင်းဖုန်းမြင့်စိုင်းဘကိုးစိုင်းဘဌေးစိုင်းဘထွန်းစိုင်းဘိုးအောင်စိုင်းမင်းဆွေစိုင်းမင်းနိုင်စိုင်းမျိုးမင်းထက်စိုင်းမျိုးမြင့်စိုင်းမြင့်စိုင်းမြင့်ထူးစိုင်းမြင့်မောင်စိုင်းမြင့်လွင်စိုင်းမြင့်သိန်းစိုင်းမြစိန်စိုင်းမြမောင်စိုင်းမြသန်း(ခ)မြသန်းစိုင်းမွန်စိုင်းမွန်းလိန်စိုင်းမိုးကျော်သူစိုင်းမုန့်ရွက်စိုင်းမောင်ရွှေစိုင်းမောင်လှစိုင်းမောင်ဝင်းစိုင်းမောင်အေးစိုင်းယီတစ်စိုင်းယီနွန်းစိုင်းယောဇက်စိုင်းရွက်စိုင်းရွှေဆိုင်းစိုင်းရွှေမှုံစိုင်းရွှေလှစိုင်းရှဲန်တစ်စိုင်းရှဲန်တစ်လုံစိုင်းရှဲန်နွန်းစိုင်းလှကျော်စိုင်းလှထွေးစိုင်းလှဖေစိုင်းလှမောင်ရွက်စိုင်းလှဝင်းစိုင်းလှဝင်းစိုင်းလှအောင်စိုင်းလှိုင်ခမ်းစိုင်းလိန်မောင်းစိုင်းလုံစိုင်းလုံစိုင်းလုံစိုင်းလုံကျော်စိုင်းလုံးဆိုင်စိုင်းလုံတစ်ရီစိုင်းလောင်ဟွမ်စိုင်းဝင်းတင်စိုင်းဝင်းဖေစိုင်းဝင်းမြင့်စိုင်းဝင်းမြတ်စိုင်းဝဏ္ဏ(ခ)သားအိုစိုင်းဝန်းဆမ်စိုင်းဝန်းတစ်စိုင်းဝန်းဖစ်စိုင်းဝါလိန်စိုင်းဝိန်းစိုင်းသန်းစိန်စိုင်းသန်းထွန်းစိုင်းသန်းနိုင်စိုင်းသန်းရွှေစိုင်းသန်းဝင်းစိုင်းသိန်းမောင်စိုင်းသိန်းမောင်စိုင်းသိန်းအောင်စိုင်းသိန်းအောင်စိုင်းသီဟစိုင်းဟန်မျိုးစိုင်းဟောင်ခမ်းစိုင်းဟောင်ခမ်းစိုင်းအိုက်ဆမ်စိုင်းအိုက်ဉာဏ်(ခ)စိုင်းစန္ဒာစိုင်းအိုက်ဝင်းစိုင်းအိုက်အေးစိုင်းအုန်းစိုင်းအုန်းဖေစိုင်းအုန်းမြင့်စိုင်းအေးစိုင်းအောင်စိုင်းအောင်ကျော်စိုင်းအောင်ကျော်စိုင်းအောင်ကျော်မိုးစိုင်းအောင်ကြည်စိုင်းအောင်ခမ်းစိုင်းအောင်ထွန်းစိုင်းအောင်ထွန်းစိုင်းအောင်နိုင်စိုင်းအောင်ဖြူစိုင်းအောင်မျိုးကျော်စိုင်းအောင်မျိုးခိုင်စိုင်းအောင်မြတ်စိုင်းအောင်လတ်(ခ)ထွန်းစိန်စိုင်းအောင်လှစိုင်းအောင်ဟိန်းမွန်းစိုးစန္ဒာနိုင်စိုးစိုးစိုးစိုးမြင့်စိုးညွန့်လွင်(ခ)စိုးကြီးစိုးတင့်စိုးတင့်စိုးတင့်စိုးတင့်စိုးတင့်အောင်စိုးထွန်းအောင်စိုးထွေးစိုးနွယ်စိုးနိုင်စိုးနိုင်စိုးနိုင်စိုးနိုင်(ခ)နိုင်ပေါ်လာစိုးနောင်စိုးပပလှိုင်စိုးပိုင်စိုးပိုင်စိုးပိုင်စိုးပိုင်စိုးပိုင်ဝင်းစိုးမင်းစိုးမင်းစိုးမင်းစိုးမင်း(ခ)စော်ဘွားကြီးစိုးမင်းစမ်းစိုးမင်းထက်စိုးမင်းသန်းစိုးမြင့်စိုးမြင့်စိုးမြင့်စိုးမြင့်စိုးမြင့်စိုးမြင့်စိုးမြင့်စိုးမြင့်စိုးမြင့်စိုးမြင့်(ခ)ညီသူဟန်စိုးမြင့်ထွန်းစိုးမြင့်သိန်းစိုးမိုးထွန်းစိုးမိုးဝင်းစိုးရယ်စိုးရယ်စိုးလွင်စိုးလွင်စိုးလွင်စိုးလွင်မိုး(ခ)ဆန်းညွန့်စိုးဝင်းစိုးဝင်းစိုးဝင်းစိုးဝင်းစိုးဝင်းစိုးဝင်းစိုးဝင်း(ခ)သွားဖရှင်းစိုးဝင်းထွန်းစိုးဝင်းအောင်စိုးသန်းစိုးသန်းစိုးသန်းစိုးသိန်းစိုးသိန်းစိုးသိန်းစိုးသိမ်းစိုးဥမ္မာစီစုစည်းနိုင်စုစုလွင်စုစုသင်းစုစုအောင်စုံဇီးမန်စုမျိုးလှိုင်စုမြတ်ထက်စုဝါဝါခင်စောကပေါ်ထူးစောကပေါ်မူးစောကျော်ကြီးစောကျော်ဇောစောကျော်ရှိန်(ခ)ကျော်စိန်စောကျော်ဝင်းစောကံရွှေစောကြည်ဝင်းစောကလူထောစောကွယ်ထူးစောကွာလာစောကိုဒီစောကီးဒိုစောကောရီယိုစောကဲဒိုစောခင်မောင်ဝင်းစောချစ်ခင်စောခရစ္စတိုဖာစောခိုနိုးစောခူးရီစောဂျိုးဇက်စောဂျူးနစ်စောဂျူဘလီစံလှစောဂျေအေဝင်းမြင့်စောဂါဂျီစောငြိမ်းစောငြိမ်းချမ်းစောငြိမ်းအောင်စောစံအေးစောစိုးဝင်းအောင်စောစေးဝါးစောစောရွှေစောဆန်နီချန်းစောဆာလောလစောညွန့်ထူးစောညီညီလွင်စောတင်ကြည်စောတင်လှိုင်စောတင်ဝင်းစောထင်ကြေးစောထွန်းစောထွန်းနောင်စောထွန်းဖြူစောထွန်းဝေစောထားလုံစောထိန်လင်းအောင်စောထူးကပေါ်စောဒဲမစီစောနွဲ့ခွန်ဆိုင်ခမ်းစောနီးနီစောနေဒွန်းစောနေရင်(ခ)စောနန္ဒကျော်စောဖိုးဝါးစောဖီးလစ်စောဖုန်းနိုင်စောဖေစောဖောမယ်စောဘင်ဂျာမင်စောဘစိန်စောဘဌေးစောဘမြင့်စောဘဲတခေးစောမြင့်စောမြင့်စောမြင့်စောမြင့်စိုးစောမြင့်အောင်စောမြတ်ထွဋ်ဝင်း(ခ)ကိုဆွိစောမြတ်လေးစောမြဖွေးစောမြသိန်းစောမြိုင်စောမားခတ်(စ်)စောမိုးကျော်စောမူးတောစောမူးလာစောမောင်စောမောင်စောမောင်ကြီးစောမောင်စံစောမောင်သိန်းစောမော်စီတုံးစောရွှေစောရွှေနာရီစောရှမွေလစောရှမူအေးလာစောရိချဒ်စောလင်းဘိုဘိုစောလင်းအောင်စောလင်းအောင်စောလွင်စောလွင်စောလှစောလှမြင့်စောလားဆက်စောလုကာစောလေး(ခ)နော်အောင်စောလဲပွဲစောဝင်းစောဝင်းထိန်စောဝင်းနိုင်စောဝင်းနေစောဝင်းမြင့်စောဝင်းမောင်စောသက်နိုင်(ခ)စောမူလျားဝေါ်စောသန်းဌေးစောသာဖြူစောသာမောင်စောသိန်းထွန်းစောသိန်းအောင်စောသူရအောင်စောသောင်းတင်စောသောင်းတင်(ခ)သောင်းတင်စောသောင်းဒန်စောသောမတ်(စ်)စောဟာဗီစောဟိုရှေးစောဟူးဟူးစောဟေသားကြီးစောအယ်ဂေးစောအုန်းတင်စောအေးကိုစောအေးမိုးစံစောအောင်ဇေယျစောအောင်တင်စောအောင်မျိုးကျော်စောအောင်လွင်စောအဲမရီစောအဲလ်ဘတ်ဆင်ဝါးလဆင်ဟတ်ဆန်းဆန်းထွန်းအောင်ဆန်ဒေါင်းဒီးဆန်းနှောင်းဆန်နိုင်စိန်ဆန်းမလူဆန်ရီဆန်းလင်းဆန်လှေးမန်ဆန်းဝင်းဆန်းဝင်းအောင်(ခ)အောင်အောင်ဆမ်ဆွန်နာဆမ်ဆောင်းကားဆရာလာမြာတားဆရဲဂျုံခွမ်ဆလိုင်းခင်မောင်လှဆလိုင်းဇီတိုးဆလိုင်းတင်ထွန်းအောင်ဆလိုင်းနောလ်ကျုံးအဲရ်(ခ)ဝေလျန်ဆလိုင်းလျန်လွယ်ဆလိုင်းလှထွန်းဆလိုင်းဝုမ်ဇပြောင်ဆလိုင်းသိန်းမောင်ဆလိုင်းဟန်ကျော်ဆွတ်နောင်ဆွန်ဒုတ်ကျင့်ဆွန်မလေး(ခ)အလေးမီးဆွမ်ဒူနော်အောင်ဆွေဆွေသင်းဆွေမြင့်(ခ)မန်းဆွေမြင့်ဆွေးမှုန်ဆွေသန်းဆွေသိန်းဆာကီးဆာဆုဆားမူဆိုင်ခေးဆိုင်းခေါန်ဆိုင်းဂျာဆိုင်းနော်ဆိုင်းနော်ဆိုင်းအင်ဆိုဖာနီးယာဆီဟူးဒွေ့ဆုခက်ခက်လင်းဆူရယ်ဆောင်ချမ်းဆောင်းတင်ဆောင်ယိန်းဆော်လမွန်ဇခုံခေါင်လွမ်း(ခ)ခေါင်ဂျယ်ဇခုန်ယိန်းဆောင်ဇင်ကိုကိုထွန်းဇင်နီနီဝင်းဇင်မင်းထွန်းဇင်မင်းထွေးဇင်မျိုးထွန်းဇင်မာဌေးဇင်မာထွေးဇင်မာလင်းဇင်မိုးထိုက်ဇင်မေဇမှုန်းဇမီရမ်ဇမ်ကီယိုးဇမ်းဆွင်းလျန်းဇယ်ခမ်ဇယ်ဇောင်းဇာနည်အောင်ဇာနည်အောင်ဇာနီဇိုဘွဲဇီဆာဇီဆီးဖာဇုတ်ဒေါင်ဇုန်းဆောင်ဇုန်းယိန်းဇေခေါင်ဇေယျာမင်းသိန်းဇေယျာမျိုးဇေယျာဝင်းဇေယျာဝင်းဇေယျာအောင်ဇောင်းခေါင်ဇော်ခင်ဇော်ခွန်ဇော်ဂျွန်းဇော်ဆိုင်းဇော်ဇော်ဇော်ဇော်ဇော်ဇော်ထွေးဇော်ဇော်ထွေးဇော်ဇော်ထူးဇော်ဇော်မြင့်ဇော်ဇော်အောင်ဇော်ဇော်အောင်ဇော်ညွန့်ဇော်တန်ဇော်ထက်ဇော်ထန်(ခ)ကိုထူးဇော်ထွန်းဇော်ထွန်းဇော်ဒွဲဇော်ဒဲဒူဇော်နိုင်ဇော်နောင်ဇော်ဖုန်းပိုင်(ခ)ကျော်ဝဇော်ဘိုဘိုထွဋ်ဇော်မင်းဇော်မင်းဇော်မင်းဇော်မင်းဇော်မင်း(ခ)ဇော်ရဲထက်ဇော်မင်း(ခ)တင်ဆန်းဇော်မင်းထွန်းဇော်မင်းထွန်းဇော်မင်းထိုက်(ခ)ကျော်သူဇော်မင်းသူဇော်မင်းအောင်ဇော်မျိုးဝင်းဇော်မြင့်ဇော်မိုးဇော်မိုးဇော်မိုးနော်ဇော်မိုးလွင်ဇော်မိုးအောင်ဇော်ရှိန်းဇော်ရောင်ဇော်လင်းဇော်လင်းဇော်လင်းတိုးဇော်လင်းထိုက်ဇော်လင်းအောင်ဇော်လတ်ဇော်လွင်ဇော်လွင်ဇော်လွင်ဇော်လွမ်တူးဇော်ဝင်းဇော်ဝင်းဇော်ဝင်းဇော်ဝင်းဇော်ဝင်းဇော်ဝင်းဇော်ဝင်းဇော်ဝင်းဇော်ဝင်းဇော်ဝင်းတင့်ဇော်ဝင်းထွန်းဇော်ဝင်းနိုင်ဇော်ဝင်းနိုင်ဇော်ဝင်းနိုင်ဇော်ဝင်းမြင့်ဇော်ဝင်းမောင်ဇော်ဝင်းလှိုင်ဇော်ဝင်းအောင်ဇော်သစ်ဇော်ဟန်ဇော်ဟိန်းလတ်ဇော်အေးဇော်အေးဇော်အေးမောင်ဇော်အောင်ဇော်အောင်ဇော်အောင်ထွန်းဉာဏ်ထွန်းဉာဏ်ထွန်းဉာဏ်ထွန်း(ခ)အောင်စိုးသိမ်းဉာဏ်ရွှေဉာဏ်လင်းဉာဏ်သိန်းညင်းခိုကျိန်ညွန့်ညွန့်ညွန့်ညွန့်စန်းညွန့်ညွန့်စိန်ညွန့်ညွန့်ဌေးညွန့်ညွန့်ဝင်းညွန့်ညွန့်ဝင်းညွန့်မောင်ညွန့်မောင်ညွန့်ရွှေညွန့်ရွှေညွန့်ရွှေညွန့်ရွှေညွန့်ရှိန်ညွန့်ဝေညွန့်ဝေညွန့်ဝေညွန့်ဝေညွန့်သိန်းညွန့်ဟန်ညွန့်အေးညွန့်အောင်ညိုညိုညိုညိုညိုညိုထွန်းညိုလင်းထင်(ခ)စိုင်းဆိုင်လှိုင်းညိုလေးညိုဝင်းညိုဝင်းဌေးညိုသိမ်းညီကလေး(ခ)ဘမောင်(ခ)ညီလေးညီစန်းညီညီညီညီညီညီညီညီညီညီညီညီညီညီ(ခ)ညီလေးချမ်းညီညီထွန်းညီညီထွန်းညီညီထွန်းညီညီထွေးညီညီမော်ညီညီဟန်ညီနပ်ညီနပ်ညီပုညီပေါင်းညီမောင်ညီသန်းဌေးကျော်ဌေးဌေးဌေးဌေးဝင်းဌေးဌေးအုန်းဌေးမြင့်အောင်ဌေးမြင့်အောင်ဌေးမောင်ဌေးမောင်ဌေးမော်ဌေးလွင်ဌေးလွင်ဌေးလွင်ဌေးလွင်ဌေးလွင်ဌေးဝင်းဌေးဝင်းဌေးဝင်းဌေးဝင်းမြင့်ဌေးအောင်ဌေးအောင်ဌေးအောင်ဌေးအောင်ဌေးအောင်ဌေးအောင်ဌေးအောင်ကြွယ်တင်တင်တင်တင်(ခ)သန်းအေးတင်ကိုတင်ကိုကိုတင်ချိုအေးတင်ခိုင်တင်ငြိမ်းတင်စိုးတင်စိုးတင်စိုးတင်စိုးတင်စိုးတင်စိုးတင်စိုးတင်စိုးတင်စိုးတင်စောတင့်ဆန်းတင့်ဆွေတင်ဆွေ(ခ)တင့်ဆွေတင်ဇာချိုတင်ဇော်လင်းတင်ဇော်ဝင်းတင်ညွန့်တင်ညွန့်တင်ညွန့်တင်ဌေးတင်ဌေးအောင်တင်တင်တင်တင်မာတင်တင်ဝင်းတင်တင်ဝင်းတင်တင်အုန်းတင်တင်အေးတင်ထွန်းတင်ထွန်းတင်ထွန်းတင်ထွန်းတင်ထွန်းနိုင်တင်ထွန်းလွင်တင်နိုင်တင်နုတင်ဖေတင်ဖေတင်မင်းသော်ဇင်တင်မျိုးတင်မျိုးဝင်းတင်မြင့်တင်မြင့်တင်မြင့်တင်မြင့်တင်မြင့်တင်မြင့်တင်မြင့်တင်မြင့်တင်မြင့်တင်မြင့်ဆွေတင်မာအေးတင်မောင်တင်မောင်တင်မောင်တင်မောင်ကြည်တင်မောင်ချိုတင်မောင်ညွန့်တင်မောင်တိုးတင်မောင်ထွန်းတင်မောင်ထွေးတင်မောင်မြင့်တင်မောင်မြင့်(ခ)နေတင်ယုတင်ရွှေတင်ရွှေတင်ရှိန်တင်ရှိန်တင်ရီတင်လင်းတင်လင်းတင်လတ်တင့်လွင်တင့်လွင်တင့်လွင်တင့်လွင်တင့်လွင်တင့်လွင်တင့်လွင်တင်လှတင်လှတင်လှိုင်တင်လှိုင်တင်လှိုင်တင်လှိုင်တင်လှိုင်တင်လုံးတင်လေးတင်ဝင်းတင်ဝင်းတင်ဝင်းတင်ဝင်းတင်ဝင်းတင်ဝင်းတင်ဝင်းတင်ဝင်းတင်ဝင်းကြည်တင်ဝင်းမြင့်တင်ဝင်းမောင်တင့်ဝေတင်သိန်းတင်သိန်းတင်သောင်းတင်သောင်းတင်အိတင်အုန်းတင်အေးတင်အေးတင်အောင်တင်အောင်တင်အောင်တင်အောင်တင်အောင်တင်အောင်(ခ)တင့်ဆွေတင်အောင်ကျော်တင်အောင်ဝင်းတွန့်ခင်းပေါင်တာတိတ်ထန်းတိုက်မြင့်တိုးဆွေတိုးတိုးတိုးတိုးတိုးတိုးကျော်တိုးပေါလ်တိုးလွင်တီရယ်တုတ်ရွှေတူးဂျာတေဇထွဋ်လှိုင်ထွေးတေဇာအောင်တောက်တော့ရယ်ထက်ထက်ဝင်း(ခ)ထက်မြက်သူထက်အောင်ကျော်ထင်ပေါ်ထင်ပေါ်(ခ)တင်ယုထင်လင်းထန်ကမ်းလျန်ထန်ကျင့်လျန်းထန်ခိုဟောက်ထန်ဂိုးခိုင်ထန်ဆွင်းဇမ်းထန်ဒို့လျန်းထန်လွန်ခုပ်ထမိုင်ယုံထွန်းကျော်ထွန်းကျော်ထွန်းကျော်ကျော်ထွန်းကြည်(မင်းကန်)ထွန်းငွေထွန်းဇော်ထွန်းညွန့်ထွန်းညွန့်ထွန်းဌေးထွန်းတင်ထွန်းတင့်အောင်ထွန်းထွန်းထွန်းထွန်းထွန်းထွန်းထွန်းထွန်းထွန်းထွန်းထွန်းထွန်းကျော်ထွန်းထွန်းခင်ထွန်းထွန်းမင်းထွန်းထွန်းမော်ထွန်းထွန်းဝင်းထွန်းထွန်းဝင်းထွန်းထွန်းဝင်းထွန်းထွန်းဝင်းထွန်းထွန်းဝင်းထွန်းထွန်းဝင်း(ခ)မဲကြီးထွန်းနိုင်ထွန်းနိုင်ထွန်းနိုင်စိုးထွန်းနေအောင်ထွန်းဖြူ(ခ)စိုးမိုးအောင်ထွန်းဗိုလ်ထွန်းမင်းအောင်ထွန်းမြင့်ထွန်းမြင့်ထွန်းမြင့်ထွန်းမြင့်ထွန်းမြင့်ထွန်းမြင့်ထွန်းမောင်ထွန်းမောင်ထွန်းမောင်ထွန်းရင်ထွန်းရင်ထွန်းရင်ထွန်းရင်ထွန်းရွှေထွန်းရွှေထွန်းရွှေထွန်းရွှေထွန်းရှိန်ထွန်းရှိန်ထွန်းရီထွန်းလင်း(ခ)ရွှေထွန်းထွန်းလင်းကိုထွန်းလွင်ထွန်းလွင်ထွန်းလှထွန်းလှစိန်ထွန်းလှမောင်ထွန်းဝင်းထွန်းဝင်းထွန်းဝေထွန်းသစ်ထွန်းသာစိန်ထွန်းဟန်ထွန်းဟိန်း(ခ)ထွန်းအေးထွန်းအေးထွန်းအေးကျော်ထွန်းအောင်ထွန်းအောင်ထွန်းအောင်ထွန်းအောင်ကျော်ထွန်းအောင်သိန်းထွယ်အောင်ထွီးမောင်ထွေးတင်(ခ)မြသိန်းထွေးထွေးလွင်ထွေးမောင်ထွေးလှထွေးလှအောင်ထိန်မင်းထိန်လင်းထိန်လင်းထိန်လင်းထိန်လင်းထိန်ဝင်းထီဆန်ဝမ်ဆင်ဆားရ်ထုဘူထူးကိုကိုထူးခိုင်ထူးဝေလင်းထောင်းခိုမန်ထောင်းဇပေါင်ဒခိဒမ်းဆားရ်အောင်ဒွမ်ဖော်မာဂွန်းဒွဲလာဒါရ်လျန်အုပ်ဒါဝိဒ်ဒါဝိဒ်ဒိန်ခန်ဒါဝိဒိန်ခန်ဖုန်(ခ)ခန်လင်ဒိုခန့်လျန်းဒိုင်ထုန်းဒိုဇပေါင်ဒူဝမ်ထုနန်ဒူဝေါမ်ဝန်တူးဒေလီယာဒေလီယာဒေါက်တာကမ်ကျင်ဒါးလ်ဒေါက်တာကျော်(ခ)အောင်ကျော်ဒေါက်တာကျော်ကျော်ဒေါက်တာကျော်ခိုင်ဒေါက်တာကျော်ဇင်ဒေါက်တာကျော်ဇေလင်း(ခ)ဇေလင်းမောင်ဒေါက်တာကျော်နိုင်ဒေါက်တာကျော်နိုင်ထွန်းဒေါက်တာကျော်လွင်ထူးဒေါက်တာကျော်သူဟန်ထွန်းဒေါက်တာကေရွယ်ဂျားဒေါက်တာခက်အောင်ဒေါက်တာခင်ခင်စီဒေါက်တာခင်စိုးဒေါက်တာခင်စောဝင်းဒေါက်တာခင်နိုင်ဒေါက်တာခင်မောင်ဌေးဒေါက်တာခင်မောင်ထွန်းဒေါက်တာခင်မောင်ဝင်းဒေါက်တာခင်မောင်ဝင်းဒေါက်တာခင်မောင်သွင်ဒေါက်တာခင်မောင်အေးဒေါက်တာခင်လှဒေါက်တာချစ်ကိုကိုဒေါက်တာချစ်ရီဒေါက်တာခွန်လှမောင်ဒေါက်တာစန်းစန်းနွယ်ဒေါက်တာစန်းရွှေဒေါက်တာစံရွှေအောင်ဒေါက်တာစဝ်ခွန်ထွန်း(ခ)စောနွဲ့ခွန်ထွန်းဒေါက်တာစိန်ဝင်းဒေါက်တာစိုင်းနော်ခေးဒေါက်တာစိုင်းဝန်းလျိုးဒေါက်တာစိုးဝင်းဒေါက်တာစိုးသန်း(ခ)ကျော်စိုးသန်းဒေါက်တာစိုးသိမ်းဒေါက်တာစိုးသူရဒေါက်တာစောညိုဝင်းဒေါက်တာစောလှထွန်းဒေါက်တာဆန်းဝင်းဒေါက်တာဇော်မင်းအောင်ဒေါက်တာဇော်မြင့်မောင်ဒေါက်တာဇော်ဝင်းဒေါက်တာညီညီအောင်ဒေါက်တာညီမင်းဟန်ဒေါက်တာဌေးနောင်ဒေါက်တာတင်ထွန်းဒေါက်တာတင်ဝင်းကျော်ဒေါက်တာတိုးတိုးအောင်ဒေါက်တာထွန်းမြင့်ဒေါက်တာထွန်းလှိုင်ဒေါက်တာထိန်လင်းဒေါက်တာထိန်ဝင်းဒေါက်တာထူးနေအောင်ဒေါက်တာနန္ဒာလှမြင့်ဒေါက်တာနန်းဇိန်းလုအောန်ဒေါက်တာဖြူဖြူခိုင်ဒေါက်တာဘမောင်ဒေါက်တာမင်းစိုးလင်းဒေါက်တာမင်းနွယ်စိုးဒေါက်တာမျိုးထွန်းဒေါက်တာမြင့်နိုင်ဒေါက်တာမြင့်သိန်းဒေါက်တာမြင့်သိန်း(ခ)မှတ်ဒေါက်တာမြတ်မြတ်မော်(ခ)နွဲ့ယဥ်အောင်ဒေါက်တာမှုထန်ဒေါက်တာမိုးသူဝင်းဒေါက်တာမေသန်းနွယ်ဒေါက်တာရဲမြင့်အောင်ဒေါက်တာလင်းထွဋ်ဒေါက်တာလွင်ကိုဒေါက်တာလှမင်းဒေါက်တာလှမျိုးဒေါက်တာလှမြတ်သွေးဒေါက်တာလှသိန်းဒေါက်တာလဲ့လဲ့မော်ဒေါက်တာဝင်းလှိုင်ဒေါက်တာဝင်းအောင်ဒေါက်တာဝင်းအောင်ဒေါက်တာဝင်းအောင်ကျော်ဒေါက်တာသန်းစိုးဒေါက်တာသန်းထွန်းဆွေဒေါက်တာသန်းမျိုးဒေါက်တာသိန်းဇော်မြင့်ဒေါက်တာသိန်းနိုင်ဒေါက်တာသိမ်းစိုးဒေါက်တာအေးဇံဒေါက်တာအေးမောင်ဒေါက်တာအောင်ကျော်ဌေးဒေါက်တာအောင်ကျော်မင်းဒေါက်တာအောင်နိုင်ဒေါက်တာအောင်ဖြိုးဒေါက်တာအောင်မြတ်ဒေါက်တာအောင်မြတ်သူဒေါက်တာအောင်မိုးညိုဒေါက်တာအောင်သန်းဒေါက်တာအောင်သန်းမောင်ဒေါက်တာအောင်အောင်သန်းထိုက်ဒေါင်ခေါင်ဒေါင်ဟောင်းဒေါင်ဟောင်းနချိုခေါင်ဒေါင်နန္ဒနန်းကမ်နန်းကျင်လှိုင်(ခ)ဗျာသားမီးနန်းကောင်ခမ်းနန်းကောင်ဖူးနန်းကော်နန်းခင်ငွေနန်းခင်ထွေးမြင့်နန်းခင်ထားရီနန်းခင်မျိုးမင်းနန်းခင်သန်းနွဲ့နန်းခမ်းကြာနန်းခမ်းယဥ်အောင်နန်းခမ်းလူနန်းခမ်းအောင်နန်းချိုချိုသန်းနန်းငွေငွေနန်းငွေမြနန်းစံနန်းစန္ဒာစုနန့်စန္ဒာဝင်း(ခ)စန္ဒာဝင်းနန်းစမ်ငင်းအောင်နန်းစမ်းစမ်းအေးနန်းစံဟွမ်နန်စိန်နန်းစီစီအေးနန်းစေအွာနန်းဆိုက်နန်းဆိုင်လင်းခမ်းအူနန်းဆိုင်ဟိန်းနန်းဆိုင်အိမ်နန်ဇမုံနန်းညွန့်ဝင်းမော်နန်းညိုနန်းထွေးငယ်နန်းထားမေနန်းနွန်းနန်းနွမ်းနန်းနွယ်နွယ်ထွန်းနန်းနွေနှောင်းနန်းနော်နော်အေးနန်းပုတ်ခမ်းနန်းဖွေးဟွမ်နန်းမျိုးမျိုးသန့်နန်းမြနန်းမြခင်နန်းမြင့်မြင့်အေးနန်းမြစန္ဒာချိုနန်းမြထွေးနန်းမြမြလွင်နန်းမြအေးနန်းမွန်းအောင်နန်းမွမ်းစိန်နန်းယင်းဟန်နန်းယဥ်ဌေး(ခ)နန်းအေးသင်နန်းရွှေကြာနန်းရွှေစင်သွေးနန်းရွှေဖြူနန်းရွှေအိမ်နန့်ရှူဂေးခလိန်နန်ရှောင်နန်းရီနန်းလှမြင့်နန်လုံနန်းလုံနန်းဝင်းကြည်နန့်သင်းသင်းထွေး(ခ)တာပိုးနန်းသန္တာနန်းသန်းသန်းနန်းသူဇာဝင်းနန်းအက်(စ်)ကီးမိုးနန်းအွမ်ခမ်းနန်းအုန်းမြိုင်နန့်ဥမ္မာမြနမ့်ခင်နွဲ့ရီနမ့်သီတာဆွေမြင့်နွယ်နွယ်စိုးနွယ်နွယ်ဝင်းနွယ်နွယ်ဝင်းနွယ်နီဝင်းနွယ်နီဝင်းနွယ်မာဝင်းနွေမှုန်နွဲ့နွဲ့ရီ(ခ)မြနန္ဒာနှင်းခိုင်စိုးနှင်းနွယ်စိုးနှင်းနွယ်စိုးနှင်းပွင့်နှင်းယဥ်ဝင်းနှင်းဝေဝေစိုးနှီာရ်ခမ်းနိန့်ခန့်ပေါင်နိန်းဒိုထန်နိန်နိုင်းနိုငြွေ်ကအေးနိုင်နိုင်ကံထွန်းနိုင်ကြည်ဝင်း(ခ)ဒေါက်တာမင်းကြည်ဝင်းနိုင်ချစ်နိုင်ငံလင်းနိုင်စိုးမြင့်နိုင်ဇော်မိုး(ခ)နိုင်ရဲဇော်နိုင်ဇော်လင်းနိုင်တင်လှိုင်(ခ)နိုင်တလထောနိုင်ထင်ကျော်နိုင်ထွန်းရ(ခ)နဲာထဝ်လျးနိုင်နိုင်ထွေးနိုင်မင်းကျော်(ခ)နေမင်းကျော်နိုင်မင်းစိုးသိန်း(ခ)မင်းစိုးသိန်းနိုင်မင်းသိန်းလွင်နိုင်မင်းအောင်နိုင်နိုင်မောင်ရီနိုင်လင်းထက်နိုင်လင်းထွန်းနိုင်လင်းအောင်နိုင်လယိတမနိုင်ဝင်းနိုင်ဝင်းနိုင်သူလတ်နိုင်းဟိုင်ကွန်းနိုင်အောင်ဌေး(ခ)အယ်စိုင်းနိုးတား(ခ)ဒါညီလေးနိုထန်ကပ်နိုးနိုးနီနီစိန်နီနီမိုးနီပွန်နီလတ်နီလှမောင်နီလာမြတ်နီလာလွင်နုနုရီနုနုရီနူးနူး(ခ)နူးနူးနောင်နေဇာလင်းနေဇော်ထွန်းနေညီထွဋ်အောင်နေထက်ရဲနေထွန်းနေနိုင်နေမင်းထွန်းနေမင်းထွန်းနေမျိုးကျော်နေမျိုးကျော်(ခ)နေဘုန်းလတ်နေမျိုးအောင်နေမျိုးအောင်နေရှင်းနေလင်းနေလင်းနေလင်းနေလင်းထွန်းနေလင်းအောင်နေဝင်းနေဝင်းနေဝင်းနေဝင်းနေဝင်းနေဝင်းဆွေနေဝင်းသန်းနော်ငြိမ်းငြိမ်းမော်နော်စိန်အေးနော်ဆန့်နော်ဆာထူးနော်တင်တင်ဝင်းနော်နာစောနော်နုနုဝါနော်ပွယ်ဆေးနော်မေးဒြတ်နော်မေးရီယံနော်လီ(ခ)ဇခေါင်ခမ်းရယ်နော်ဝါးဝါးထူးနော်သေးဂေနော်သေထီးဖောနော်အေးစံပါယ်နော်အေးအေးလွင်နော်အောင်ဂျာနော်အဲအယ်ဖိုးနဲနယ်ပန်းရီပန်းသဥ္ဇာမျိုးပပဟန်ပြည်စိုးဝင်းပြည့်စုံပြည်ယိုးပြည်အေးပြုံးချိုပြုံးသက်ဆွေပြေမင်းပြေဝင်းပြေသိမ်းပါ(ခ)ခင်မောင်ဆွေပါထွေးပိုင်းကီးပီတာသောင်းစိန်ပုတ်ပုန်ဘွေပူထန်ဒိတ်ခုတ်ပေါင်းခမ်းပေါင်လွန်းမင့်ထန်ပေါရွှေပေါလုပေါလုပေါလုပေါလူဖရန်စစ်(ခ)ဦအိုင်ရှဲန်ဖြိုးဇော်ရွှေဖြိုးဇော်အောင်ဖြိုးမင်းသိန်းဖြိုးမောင်ဖြိုးဝင်းထွန်းဖြိုးဝေသိမ့်ဖြိုးသန့်ဆွေဖြိုးသော်ဇင်ဖြူဖြူချိုဇော်ဖြူဖြူညွန့်ဖြူဖြူဝင်းဖလားမေရမ်ဖွေအားဖိုး(ခ)ရွှေဖိုးဖိုးကြည်ဖိုးစံဖိုးဖြူဖိုးမင်း(ခ)ဘိုးမင်းဖိုးမြင့်ဖိုးရယ်(ခ)ဘအေးဖိုးရီဖုန်းဖုန်းဇော်ဟန်ဖုန်းတင့်ဖုန်းမြင့်(ခ)ကိုရင်ဖုန်မောင်ခန်ဆားရ်ဖေကြွယ်ဖေစိုးဖေမြင့်ဖေဝင်းဖေသိန်းဖေသိန်း(ခ)ဘောဂဖေသောင်းဖော်လားကမ်ဖန်ဖော်လေဆာဗန်ကျင်းဗန်ချန်ကျဲအိုဗန်ထန်းဗန်ထောင်းဗန်ဘွဲ့လျံခုမ်းဗျားရယ်ရှားဗိုလ်ချုပ်ဗိုလ်ထွေးဗိုလ်ဗိုလ်ဇင်ဗိုလ်ဝင်းဗိုလ်သိန်းဘကြူးဘခင်ဘခင်(ခ)အောင်မင်းဘထီးဘထောက်ဘမောင်ဘမော်ဘရန်ဆိုင်းဘရန်ဒီးဘရန်နန်ဘရန်မိုင်(ခ)ဒီဘရန်မိုင်ဘရန်ရှောင်ဘလွင်ဘွဲ့တီးဘသိန်းဘသိန်းဘသိန်းဝင်းဘိုးခါဘိုးနွဲ့ဘိုဘိုဘိုဘိုမင်းဇော်ဘိုမြင့်အောင်ဘိုမောင်းဘိုးသန်းညွန့်ဘီထောဇောင်းဘုန်းကြွယ်ဘုန်းကြွယ်ဘုန်းမော်ဘုန်းမော်ရွှေဘေဘီအုန်းဘေရင်နယ်(ခ)ခင်မောင်လွင်ဘောက်ဂျာဘော့စ်ကိုဘောမ်မှော်ဘောမ်ယိန်းဘောမ်လန်းဘော်နီမကြူး(ခ)ကြောင်မာမခေါ်ဘောက်နော်မင်းမင်းမင်းကံလင်းမင်းကိုခိုင်မင်းကိုအောင်မင်းငွေထွန်းမင်းစိုးမင်းစိုးမင်းဇော်မင်းဇော်မင်းမင်းတင်ဝင်းမင်းထင်အောင်ဟန်မင်းထွန်းတင်မင်းထွန်းလွင်မင်းထွန်းအောင်မင်းနွယ်အောင်မင်းနိုင်မင်းပါလေးမင်းမင်းမင်းမင်းမင်းမင်းမင်းမင်းကျော်မင်းမင်းကြည်မင်းမင်းဆွေမင်းမင်းဇော်မင်းမင်းဇော်မင်းမင်းထွန်းမင်းမင်းနီမင်းမင်းသန်းမင်းမင်းသိန်းမင်းမင်းအိမင်းလွင်မင်းလွင်မင်းလွင်မင်းလွင်မင်းလွင်(ခ)မြင့်မင်းဝဏ္ဏကြီးမင်းသက်ဇင်မင်းသက်နိုင်မင်းသိန်းထွန်းမင်းသီဟမင်းဟန်မင်းဟိန်းမင်းအောင်မင်းအောင်မင်းအောင်မင်းအောင်မင်းအောင်စိုးမင်းအောင်မွန်မင်းအောင်သန်းမတင်နု(ခ)မပုချေမနာမ်တူးဂျာမနားရှင်းမန်းမန်းကျော်ဖိုးမန်းကျော်ရှိန်မန်းကျော်အေးမန်းကြည်ဝင်းမန်းကြယ်ဝင်းမန်းခင်မောင်အေးမန်းခိုင်းဒေမန်းခီလားမန်းဂျော်နီမန်းငြိမ်းရွှေမန်းစံကင်းမန်းစမ်းစန်မန်းစိန်လှဖုန်းမန်းစိုးသန်းမန်းဆုဆိုင်မန်းတင်မောင်အေးမန်းထွန်းတင်မန်းထွန်းဝင်းမန်းထွန်းအေးမန်းထိန်ဝင်းစိန်မန်းနေသွေးခိုင်မန်းနေသူရိန်မန်းမျိုးဇံမန်းမြင့်ဆွေမန်းရွှေလင်းစိန်မန်းရီသိန်းခန့်မန်းဝင်းထွန်းမန်းဝေလှမန်းသန်းဌေးအောင်မန်းသန်းရွှေမန်းသန်လျင်အောင်မန်းသိန်းစိုးမန်းသိန်းတန်မန်းသိန်းဝင်းမန်းအောင်ကျော်ဝင်းမန်းအောင်ကိုမင်းမန်းအောင်ထွန်းခင်မန်းအောင်ပြည်စိုးမန်းအောင်မျိုးမဘုဒဂုဏ်မမကြီး(ခ)မြင့်မြင့်သိန်းမျိုးမျိုးမျိုး(ခ)မျိုးအောင်မျိုးကျော်မျိုးကျော်သူမျိုးကြည်မျိုးကိုကိုမျိုးခင်မျိုးခင်မျိုးချစ်မျိုးခိုင်မျိုးဆွေမျိုးဆွေမျိုးဇော်မျိုးဇော်မျိုးဇော်လင်းမျိုးညွန့်မျိုးညွန့်အောင်မျိုးတင့်မျိုးထွဋ်မျိုးထွန်းမျိုးထွန်းမျိုးနိုင်မျိုးပပကျော်မျိုးမင်းမျိုးမင်းထွဋ်မျိုးမင်းထွဋ်မျိုးမင်းလှိုင်(ခ)မောင်မောင်မျိုးမင်းဟန်မျိုးမင်းအောင်မျိုးမင်းအောင်မျိုးမင်းအောင်မျိုးမျိုးထိုက်မျိုးမျိုးသိန်းမျိုးမြင့်မျိုးမြင့်မျိုးမြင့်မျိုးမြင့်မျိုးမြင့်ထွန်းမျိုးမြင့်အောင်မျိုးလှိုင်မျိုးဝေမျိုးသစ်(ခ)ပါလေးမျိုးသန့်မျိုးသိန်းမျိုးသိန်း(ခ)မြသိန်းမျိုးအောင်မျိုးအောင်မျိုးအောင်မရစ်ဖုန်မြမြကြည်မြကြိုင်မြငွေမြင့်မြင့်မြင့်မြင့်မြင့်မြင့်မြင့်မြင့်မြင့်ကျော်မြင့်ကျော်မြင့်ကျော်မြင့်ကျော်ဝင်းမြင့်ကြည်မြင့်ကြည်မြင့်ကြည်မြင့်ကြိုင်မြင့်ကြိုင်မြင့်ငွေမြင့်စန်းမြင့်စန်းမြင့်စိန်မြင့်စိုးမြင့်စိုးမြင့်စိုးမြင့်စိုးမြင့်စိုးမြင့်စိုးဝင်းမြင့်စိုးဝင်းမြင့်စိုးအောင်မြင့်ဆွေမြင့်ဆွေမြင့်ဆွေမြင့်ဆွေမြင့်ဆွေမြင့်ဆွေမြင့်ဆွေမြင့်ဆွေမြင့်ဆွေမြင့်ဆွေမြင့်ဆွေ(ခ)ကိုမြင့်မြင့်ဆိုင်မြင့်ဇော်မြင့်ဇော်မြင့်ဇော်မြင့်ဇော်မြင့်ဇော်(ခ)စော်ဘွားမြင့်ညိမ်းမြင့်တင်မြင့်ထွန်းမြင့်ထွေးမြင့်နိုင်မြင့်နိုင်မြင့်နိုင်မြင့်ဖေမြင့်ဖေမြင့်မြင့်ကြူမြင့်မြင့်စန်းမြင့်မြင့်စန်းမြင့်မြင့်ဝင်းမြင့်မောင်မြင့်မောင်မြင့်မော်မြင့်ရွှေမြင့်ရွှေ(ခ)ဖိုးပါမြင့်လွင်မြင့်လွင်မြင့်လွင်မြင့်လွင်မြင့်လွင်မြင့်လွင်မြင့်လှိုင်မြင့်ဝေမြင့်သန်းမြင့်သန်းဌေးမြင့်သိန်းမြင့်သိန်းမြင့်သိန်းမြင့်သိန်းမြင့်သိန်းမြင့်သိန်းမြင့်သိန်းမြင့်သိန်းမြင့်သိန်းမြင့်သိန်းမြင့်သီတာမြင့်သူမြင့်သောင်းမြင့်သောင်းမြင့်အေးမြင့်အေးမြင့်အောင်မြင့်အောင်မြင့်အောင်မြင့်အောင်မြင့်အောင်မြင့်အောင်မြင့်အောင်မြင့်အောင်မြင့်အောင်မြင့်အောင်မြင့်အောင်မြင့်အောင်မိုးမြစန်းမြစိန်မြစိုးမြစိုးမြတ်ကိုမြတ်ကိုမြတ်ကောင်းမြတ်ခိုင်မြတ်စိမ်းမြတ်စိုးမြတ်စိုးမြတ်စိုးမြတ်စုခိုင်မြတ်ဆုမွန်မြတ်ဇော်မြတ်ထွန်းမြတ်မင်းသူမြတ်မာလာထွန်းမြတ်သန်းထွန်းမြတ်သူမြတ်သူအောင်မြမင်းမြမေမြမောင်မြရည်စိုးမြလှစံမြဝင်းမြသန်းမြသန်းမြသွေးစံမြသိင်္ဂီမော်မြသိန်းမြသိန်းမြသိန်းမြသိန်းမြသိန်းထွန်းမြသောင်းမြအေးမြအောင်မြအောင်မြအောင်မလောင်ဒီးဆားရ်မွန်စိန်အောင်မွန်းမွန်းပန်မွှေးမွှေးခင်မှင်မှိုင်းညိုမာခါး(ခ)ဂျီမာခါးမာနာဆီမိစန်းယုမွန်မိတုံဂမ်အောင်(ခ)ဘရန်အောင်မိတုံနော်ဂျာမိမိမော်မိလဝီဟန်မိုးကျော်သူမိုးကိုကိုမိုးခမ်းမိုင်ခင်မာဖြူမိုင်းငိုအောင်မြင့်မိုင်စုစုလှိုင်မိုင်းထွန်းအေးမိုင်းမျိုးအောင်မိုင်းရဲကျော်သူမိုင်းလှကျော်မိုင်းလှအောင်မိုးဆွေမိုးနိုင်မိုးနိုင်ကျော်မိုးမခမိုးမင်းဝင်းမိုးမြင့်မိုးမြင့်ဇော်မိုးမြင့်မင်းမိုးမြင့်သိန်းမိုးမိုးခိုင်မိုးမိုးစုကြည်မို့မို့မာမိုးသူဇာကျော်မီရယ်(ခ)ရဲအောင်မုန်ဆန်မူမူခင်မူမူမြင့်မေပုလဲခိုင်မေဖြူဆွေမေဖြူဝင်းမေမျိုးမြင့်ခိုင်မေရီနျို့မေသန္တာမောင်မောင်ကျော်ဇံမောင်ကျော်မြမောင်ကြည်မောင်ကြိုင်(ခ)နိုင်ဝင်းမွန်မောင်ကိုမောင်ကိုမောင်ကောက်မောင်ငွေမောင်စိုးမောင်စိုးမောင်ဆန်းမောင်ဆွေမောင်ညွန့်စိန်မောင်ညိုမောင်ညိုမောင်ညိုမောင်ဌေးမောင်တင်မောင်မောင်တေးမောင်ထွန်းလှိုင်မောင်ထွန်းဝင်းမောင်ထွေးမောင်ထူးမောင်နုချေမောင်ပုမောင်ဖြူလှမောင်ဖိုးကျော်မောင်ဘညွန့်မောင်မြင့်မောင်မြင့်မောင်မောင်မောင်မောင်မောင်မောင်မောင်မောင်မောင်မောင်(ခ)ထိပ်တင်မောင်မောင်(ခ)မောင်မောင်လတ်မောင်မောင်(ခ)ဟိန်းလတ်မောင်မောင်ကျော်မောင်မောင်ကြီးမောင်မောင်ကြီးမောင်မောင်ချစ်မောင်မောင်စိုးမောင်မောင်စိုးမောင်မောင်ညွန့်မောင်မောင်ထွန်းမောင်မောင်ထွန်းမောင်မောင်ဖြူမောင်မောင်မြင့်စိန်မောင်မောင်မြင့်အေးမောင်မောင်လင်းမောင်မောင်လတ်မောင်မောင်လတ်မောင်မောင်လွင်မောင်မောင်ဝင်းမောင်မောင်ဝင်းမောင်မောင်ဝင်းမောင်မောင်သက်မောင်မောင်သန်းမောင်မောင်အုန်းမောင်မောင်အေးမောင်မောင်အေးမောင်ရှင်းမောင်ရီ(ခ)ရီမောင်လန်းမောင်လှကျော်မောင်လှိုင်မောင်လုံးမောင်ဝင်းမောင်ဝင်း(ခ)အောင်ဝင်းမောင်ဝမ်း(ခ)နိုင်ဝမ်းမောင်ဝေမောင်သန်းစိန်(ခ)မောင်မောင်မောင်သာခိုင်မောင်သာဇံမောင်သိန်းမောင်အုန်းမောင်အေးမောင်အေးမောင်အေးမောင်အေးမောင်အေးသိန်းမောရစ်မောရှေ့မော်နီကားမော်ရယ်မော်ရီယမင်းပိုင်ယဥ်ထွေးယဥ်မင်းအေးယဥ်ယဥ်ကြော့ယဥ်ယဥ်ညွန့်ယဥ်ယဥ်မြင့်ယဥ်ယဥ်လှယဥ်ယဥ်ဝင်းယဥ်ယဥ်အောင်ယဥ်အေးယာထွန်း(ခ)ယာဝန်းယိန်းဆောင်ယေဆာကြေလှယောက်လူယောင်ရန်းယောဆီယောဇယောဘယောရှုယောသပ်ယော်ဆာရဲ့ရင်သောင်းရည်နွယ်ထွန်းရတနာစိုးဇော်ရန်ကင်းရန်ကျော်ရန်နမ်းဖုန်ရန်နိုင်ရန်နိုင်စိုးရန်နိုင်ဆွေရန်နိုင်ဖြိုးရန်မျိုးအောင်ရန်မျိုးအောင်သိန်းရန်ရှင်းရန်ရောရန်အောင်ရန်အောင်မင်း(ခ)ဂေးမောင်ရယ်ခေါင်ရွှေရွှေကြိမ်းရွှေကွန်းရွှေဂဲရွှေစောရွှေဌေးရွှေထွီးရွှေထွေးရွှေထီးအိုးရွှေနန်းရွှေနိုင်းရွှေဘော်စိန်ရွှေမင်း(ခ)ဆီဖာလာလူးရွှေမြင့်ရွှေမှတ်ရွှေမောင်ရွှေယင်(ခ)ထွန်းရင်ရွှေလှရွှေလှရွှေလေးရွှေသက်ရွှေသာရွှေးအာလ်ရွှေအေးရွှေအောင်ရွာလ်ကျုံးရွဲရှန်ဂမ်နော်ရိန်ရှန်မန်းရှာမွှေလှရှာမွေလရှဲန်ရှားဟီရှိန်ရှိန်းဂေငိုင်းရှိမ်မြင့်ရှောမိ(ခ)စိုင်းခင်မောင်ရှဲကြာရားနီရာလ်နှင်ရားဝမ်ဂျုံရိထင်ရိန်ဒမ်းဆင်ရီရီးချက်ရီရီချိုရီရီထွန်းရီရီထိုက်ရီရီမြင့်ရီရီဝင်းရီလှိုင်ရေအေးရော်ဘင်(ခ)မရစ်နော်ရဲကျော်ရဲဆွေရဲတင့်ရဲတင့်ရဲထွဋ်ရဲထွဋ်အောင်ရဲနိုင်အောင်ရဲမင်းရဲမင်းရဲမင်းထွန်းရဲမင်းထွန်းရဲမြင့်ရဲမြင့်ရဲမြင့်ဆွေရဲမြင့်ထွန်းရဲမြင့်သိန်းရဲလင်းနိုင်ရဲလင်းအောင်ရဲလင်းအောင်ရဲဝင်းရဲဝင်းရဲဝင်းလကင်ခေါင်လွမ်းလခရန်အောင်ခမ်းလခရိဇော်ဘောက်လဂျွန်ငန်ဆိုင်းလင်းထွဋ်ဖြိုးလင်းထွန်းလင်းနိုင်ထွန်းလင်းနိုင်မြင့်လင်းလင်းကျော်လင်းဝင်းပိုင်လင်းဝင်းမင်းလင်းအောင်လင်းအောင်ဆွေလဆိုင်းလဇိန်အောင်လမြာပေါ်(ခ)ဒါဝိဒ်လျန်းခန့်ဟန်လျန်နောင်လျူတယ်ချောင်(ခ)အောင်ခိုင်လရှန်ဘန်ထွယ်လရှီးထွယ်ဘောက်(ခ)ထွယ်ဘောက်လရှီးလလရိန်လရိန်လွင်စိုးမင်းလွင်လွင်မြင့်လွန်ခိုမန်လွမ်းခေါင်လွမ်းဇောင်းလွမ်းဒေါင်လွမ်းလမ်းလွီးစ်ကျော်ကျော်လှလှလှကျော်မောင်လှံကြယ်လှကြွယ်လှကြိုင်လှကြိုင်လှကောင်းလှခင်လှချစ်လှခိုင်လှခိုင်လှငွေလှစိန်မောင်လှစိုးလှစိုးလှစောအောင်လှဌေးလှဌေးလှတိုးလှထွန်းလှထွန်းလှထွန်းလှထွန်းလှထွန်းလှထွန်းလှထွန်းလှထွန်းနိုင်လှထွန်းအောင်လှထွေးလှထွေးလှထွေးလှပြုံးလှပိုလှဖြိုးလှဖေလှဘုန်းလှမင်းလှမျိုးဆွေလှမြင့်လှမြင့်လှမြင့်လှမြင့်လှမြင့်လှမြင့်လှမြင့်လှမြင့်လှမြင့်လှမြင့်လှမြင့်လှမြိုင်လှမိုးလှမိုးအောင်လှမေလှမောင်လှမောင်လှမောင်သိန်းလှမောင်သိန်းလှရွှေလှရွှေလှရွှေလှရွှေလှရှိန်လှရဲထွဋ်လှလှဌေးလှလှရီလှလှဝင်းလှဝင်းလှဝင်းလှဝင်းလှဝင်းလှဝေလှသိန်းလှသိန်းလှသိန်းလှသိန်းအောင်လှသောင်လှသောင်းလှဟန်လှအောင်လှအောင်လှအောင်ညွန့်လှိုင်စိုးလှိုင်မင်းအောင်လှိုင်မြင့်လှိုင်မြင့်လှိုင်မြင့်သန်းလှိုင်လှိုင်ယုလှိုင်ဝင်းလအောင်လအောင်လာမေတားလားလာ(ခ)ဘူးဒေါ့လာလ်ထောင်ထန်းလားလ်ဗင်ထန်းလာလ်ဗျက်ထန်လာလ်မောင်ကျုံးလိန်းစိမ်းလိန်းထန်းလိန်သင်ခွလိန်းဟာလီပေါ်ရဲ့လီလီထုလူဖေဝင်းလေထွန်းစိန်လေမေဖူလေမေလေး(ခ)အလေးဖားဖားလေးမောင်လောင်ဝူးလော့ဒ်အောင်လောဖျန်လောရှာလောဟုန်းကီးလော်ယုံလဲ့လဲ့ဌေးဝင်းဝင်းဝင်းဝင်းဝင်းကျော်ဝင်းကျော်ဝင်းကျော်(ခ)အိုက်မိန်းဝင်းကြည်ဝင်းကြိုင်ဝင်းကြူဝင်းကိုဝင်းကိုကိုဝင်းကိုကိုဝင်းဝင်းစွမ်ဝင်းဆန်းဝင်းဆွေဝင်းဆောင်ဝင်းဇော်ဝင်းဇော်ဝင်းဇော်ဝင်းဇော်မြင့်ဝင်းညွန့်ဝင်းညွန့်ဝင်းဌေးဝင်းဌေးဝင်းတင်ဝင်းတင်ဝင်းတင်ဝင်းတင်ဝင်းတင့်ဝင်းတင့်ဝင်းတင့်ဝင်းထွဋ်(ခ)မြဝင်းဝင်းထွန်းနိုင်ဝင်းထွန်းနိုင်(ခ)ရွှေဘော်ဝင်းထွန်းမြင့်ဝင်းထိန်ဝင်းထူးဝင်းနိုင်ဝင်းနိုင်ဝင်းနိုင်ဝင်းနိုင်ဝင်းနိုင်ဝင်းနိုင်ဝင်းနိုင်ဝင်းနိုင်ဝင်းနိုင်(ခ)ဝင်းနိုင်ဝင်းနိုင်လင်းဝင်းဖေဝင်းဖေဝင်းမင်းထွန်းဝင်းမင်းထွေးဝင်းမြင့်ဝင်းမြင့်ဝင်းမြင့်ဝင်းမြင့်ဝင်းမြင့်ဝင်းမြင့်ဝင်းမြင့်ဝင်းမြင့်ဝင်းမြင့်ဝင်းမြင့်ဝင်းမြင့်ဝင်းမြင့်ဝင်းမြင့်ဝင်းမြင့်ဝင်းမြင့်ဝင်းမြင့်(ခ)ဝင်းမြင့်ခင်ဝင်းမြင့်ကျော်ဝင်းမြင့်ခိုင်ဝင်းမြင့်စိုးဝင်းမြင့်စိုးဝင်းမြင့်မောင်ဝင်းမြင့်လှိုင်ဝင်းမောင်ဝင်းမောင်ဝင်းမောင်ဝင်းမောင်ဝင်းမောင်ဝင်းမောင်ဝင်းမောင်ဝင်းမောင်ဝင်းမောင်(ခ)ဝင်းမောင်ဝင်းမောင်မြင့်ဝင်းမော်ဝင်းရွှေဝင်းရွှေဝင်းရှိန်ဝင်းရှိန်(ခ)ကောက်ဝင်းလှိုင်ဝင်းလှိုင်ဝင်းလှိုင်(ခ)ညိုဝင်းဝင်းကြူဝင်းဝင်းခိုင်ဝင်းဝင်းထိုက်ဝင်းဝင်းမော်ဝင်းဝင်းအောင်ဝင်းသန်းဝင်းသိန်းဝင်းသိန်းဝင်းသိန်းဝင်းသီတာဝင်းအောင်ဝင်းအောင်ဝင်းအောင်ဝင်းအောင်ဝင်းအောင်ဝဏ္ဏဝဏ္ဏကျော်ဝဏ္ဏကျော်ထင်ဝဏ္ဏစိုးဝဏ္ဏလင်းဝဏ္ဏအောင်ဝဒမ်းဒီးဝှန်ဆန်(ခ)ယောဝိဝါယမ(ခ)ရာဇဝါဝါမြင့်ဝါဝါရှိန်ဝိုင်းဝိုင်းကြီးဝိုင်းချစ်အောင်ဝိုင်းဒူဝိုင်ယောဟန်ဝီကောဝီလျံဇော်ထိုက်ဝုန်လွန်းကျိန်ဝေစန်းဝေဇင်ဝေဖြိုးဝေဖြိုးဟန်ဝေယံထွန်းဝေလင်းဝေလင်းဝေလင်းစိုးဝေလွင်ဝေဝေထွန်းဝေဝေလွင်သက်ကိုလေးသက်ခိုင်သက်ခိုင်သက်ခိုင်သက်စိန်သက်ဇင်ဌေးသက်ဇွန်လင်းထင်သက်တင်သက်တင်ထွန်းသက်ထွန်းသက်ထွန်းသက်ထွန်းမောင်သက်ထွန်းဝင်းသက်ထွေးသက်ထားနွယ်ဝင်းသက်နိုင်သက်နိုင်စိုးသက်နိုင်ဝင်းသက်မင်းဇော်သက်မွန်အေးသက်မာသက်လင်းသက်ဝင်းသက်ဝင်းလှိုင်သက်သက်မူသင်းမြမြသင်းသင်းသင်းသင်းသင်းကြူသင်းသင်းဆွေသင်းသင်းဖြူသင်းသင်းမူသင်းသင်းလှိုင်သင်းသင်းဝင်းသစ်သစ်မြင့်သနြွေ်းက(ခ)သန်းကြွယ်သန္တာမိုးသန္တာအေးသန်းသန်းသန်းကြည်သန်းငွေသန်းစိန်သန်းစိုးသန်းစိုးသန်းစိုးမြင့်သန်းစိုးအောင်သန်းဆွေသန်းဆွေသန်းဆွေသန်းဆွေသန်းဆွေသန်းဆွေသန့်ဇင်သန့်ဇင်သန့်ဇင်သန့်ဇင်ဌေး(ခ)ဖိုးသားသန့်ဇင်ထွန်းသန့်ဇင်ဝင်းသန့်ဇင်အောင်သန်းဇော်သန်းဇော်သန်းဇော်သန်းဇော်သန်းဇော်သန့်ဇော်သန့်ဇော်ဝင်းသန်းညွန့်သန်းညွန့်ဝင်း(ခ)သန်းညွန့်သန်းဌေးသန်းဌေးသန်းဌေးသန်းဌေးအောင်သန်းတင်သန်းထွဋ်သန်းထွဋ်သန်းထွန်းသန်းထွန်းသန်းထွန်းသန်းထွန်းသန်းထွန်းသန်းထွန်းသန်းထွန်းသန်းထွန်းသန်းထွန်းသန်းထွန်းသန်းထွန်းဝင်းသန်းထိုက်သန်းထိုက်သန်းထိုက်သန်းထိုက်သန်းထိုက်အောင်သန်းထိုက်အောင်သန်းထိ���က်(ခ)သိန်းထွန်းသန်းနွယ်သန်းနိုင်သန်းနိုင်သန်းနိုင်သန်းနိုင်သန်းနိုင်သန်းနိုင်(ခ)ဘသိန်းသန်းဖေကြီးသန်းမြင့်သန်းမြင့်သန်းမြင့်သန်းမြင့်သန်းမြင့်သန်းမြင့်သန်းမွှေးသန်းမောင်သန်းမောင်သန်းရွှေသန်းရှိန်သန်းရီသန်းလွင်သန်းလွင်သန်းလွင်သန်းလွင်သန်းလွင်သန်းလွင်သန်းလှိုင်သန်းလှိုင်သန်းလှိုင်သန်းဝင်းသန်းဝင်းသန်းဝင်းသန်းဝင်းသန်းဝင်းသန်းဝင်းသန်းဝင်းသန်းဝင်းဇော်(ခ)ကိုဇော်သန်းဝေသန်းဝေသန့်ဝေကျော်သန်းသန်းစိုးသန်းသန်းဌေးသန်းသန်းထွေးသန်းအေးသန်းအေးသန်းအောင်သန်းအောင်သန်းအောင်သန်းအောင်သန်းအောင်သန်းအောင်သြတသွင်သွယ်သွယ်သွယ်မိုးသွယ်သွယ်အေးသာစိန်(ခ)မောင်သာစိန်သာဇံသာညွန့်သာထွန်းအေးသာထွန်းအောင်သာဒိုးသာလူချေသာအေးသာအောင်သာအောင်သိန်းသိန်းသိန်းသိန်းကျော်သိန်းကျော်အောင်သိန်းစံသိန်းစိုးထွန်းသိန်းဆွေသိန်းဆွေသိန်းဆွေသိန်းဇော်သိန်းဇော်သိန်းဇော်သိန်းဇော်သိန်းဇော်သိန်းဇော်သိန်းဇော်သိန်းဇော်မိုးသိန်းဇော်လတ်သိန်းဌေးသိန်းဌေးသိန်းတန်သိန်းထွဋ်သိန်းထွန်းသိန်းထွန်းသိန်းထွန်းသိန်းထွန်းသိန်းထွန်းသိန်းထွန်းသိန်းထွန်းသိန်းထွန်းသိန်းထွန်းအောင်သိန်းထိုက်သိန်းနိုင်သိန်းနိုင်သိန်းနိုင်ဝင်းသိန်းဖြူသိန်းမြင့်သိန်းမြင့်သိန်းမြင့်သိန်းမြင့်သိန်းမြင့်ထွန်းသိန်းမေသိန်းမောင်သိန်းလွင်သိန်းလွင်သိန်းလွင်သိန်းလွင်သိန်းလွင်သိန်းလွင်သိန်းလွင်သိန်းလှသိန်းလှသိန်းလှိုင်သိန်းလှိုင်ဝင်းသိန်းဝင်းသိန်းဟန်သိန်းအောင်သိန်းအောင်(ခ)စဲရယ်သိမ်းထွန်းသိမ်းမောင်သိုးရယ်သီတာသီတာသီတာ(ခ)သီတာမောင်သီတာခိုင်သီတာငြိမ်းသီတာစိုးသီသီထွန်းသီသီလွင်သီဟထွန်း(ခ)ကိုလတ်သီဟန်သုတသူဇာမြင့်သူရသူရသူရဇော်သူရအောင်သူရအောင်သူသူဇင်သေ့ရယ်သောင်းကျော်သောင်းကြည်သောင်းကြည်သောင်းကြည်သောင်းငွေသောင်းစိန်သောင်းစိန်သောင်းစိန်သောင်းဆွေသောင်းညွန့်သောင်းညွန့်သောင်းညွန့်သောင်းဌေးသောင်းတန်သောင်းထွဋ်သောင်းထွန်းသောင်းထိုက်သောင်းမြင့်သောင်းမြင့်သောင်းရွှေသောင်းရွှေသောင်းရွှေ(ခ)ညီသောင်းသောင်းလှသောင်းဝင်းသောင်းဝင်းသော်ဇင်ဝင်းသော်တာအောင်သဲစုမွန်သဲစုဝေသဲမောင်မောင်ထက်ဟက်စတန်ဟန်စိန်ဟန်စိုးဟန်ဇော်ထွန်းဟန်ဇော်ဝင်းဟန်တင်ဟန်ထွန်းဟန်မင်းတင်ဟန်မင်းထွန်းဟန်လျန်းခိုင်ဟန်ဝင်းစိုးဟန်ဝင်းရွှေဟန်သိန်းမောင်ဟျူးဘတ်ဘယ်ရီဟရမ်ကျဲယိုဟရွဲ(ခ)ထွန်းအောင်ဟွန်ခဲန်းဟံသောင်းဟာရှိန်းကီးဟိန်းထက်ဟိုပင်ဟုန်းငိုင်းဟုန်းအွမ်ဟောက်ဆွင်းမန်ဟောင်းခေါင်ဟောင်းခေါင်ဟောင်းဂျုံးအက်စ်ကမ်ဖန်အင်ခန့်ဂိုအင်ဂျာနော်အောန်အင်ဂွန်းနော်ဂျာအင်ဒေါင်ဂျာနော်(ခ)နေထွန်းအောင်အင်နန်းဂမ်အင်ပီဆိုင်းနော်(ခ)ဆိုင်းနော်အင်ဖရောင်းဂမ်အထင်(ခ)နော်လော်န်အဒန်ဇော်မိုင်အန်းဂျေလိုအန့်ဇော်အဖြူချေအမာအမာကြည်အမ်ဇော်နန်အယိုင်စဥ်အယ်(လ်)ဇော်ဂျွန်းအယ်လ်ဖောင်းရှိုအလံပေါ့အလေးပါးအွမ်ယောအာကာလင်းအားကိုအားခီဒါဝူအားခီယောထအားဆီအားတီယောဟန်အားဖာအားဖီဆဲအားဖီမူလာဖီအာဗေလှအာမြာဟံအားမဲအာရ်ဂျွန်စိုင်းအားလီအားဝူးမွှေးအိစက်နိုင်အိနန္ဒာလွင်အိပ်(ချ်)ဂျိုဂိုင်အိမွန်သိမ့်အိရွှေဇင်အိသူဇာထွန်းအိအိဖြိုးအိအိလွင်အိုက်ကျန်ခမ်းအိုက်ကျော်အိုက်ခမ်းလှိုင်အိုက်စိုင်းအိုက်စိုင်း(ခ)အေးစိုင်းအိုက်ဆိုက်အိုက်ဆိုင်အိုက်နွန်းအိုက်မန်အိုက်မွန်းအိုက်မောင်အိုက်ရှဲန်အိုက်ရှဲန်အိုက်ရီနွံအိုက်အေးအီးရှာမွေအုန်းကြည်အုန်းကြိုင်အုန်းဖေအုန်းဘိုးအုန်းမြင့်အုန်းမြင့်အုန်းလွင်အုန်းလှိုင်အုန်းသွင်အေးကျော်အေးကျော်အေးကျော်အေးကျော်အေးကြည်အေးကြူအေးကိုအေးကိုအေးကိုအေးချိုအေးချိုစိန်အေးခိုင်အေးငြိမ်း(ခ)အေးချိုအေးငွေအေးစန္ဒာလင်းအေးစိုးအေးဆွေမြင့်အေးဆောင်အေးတင်အေးထွန်းအေးထွန်းအေးထွန်းမင်းအေးနိုင်အေးမင်းအေးမင်းအေးမင်းအေးမင်းစိုးအေးမင်းစိုးအေးမင်းထွေးအေးမင်းမိုးအေးမင်းဝင်းအေးမြတ်မွန်အေးမွန်စိုးအေးမဟော်အေးမာအေးမောင်အေးမောင်အေးမောင်အေးယုမော်အေးရွှေအေးရွှေအေးရွှေအေးလွင်အေးလွင်အေးလွင်အေးလှိုင်အေးဝင်းအေးဝင်းအေးဝင်း(ခ)ဝင်းကြည်အေးသန့်ဆွေအေးသွင်အေးသွင်အေးသာအောင်အေးသီတာအေးသောင်အေးအေးခိုင်အေးအေးခိုင်အေးအေးခိုင်အေးအေးမင်းအေးအေးမာအေးအေးမာအေးအေးမူအေးအေးသက်အေးအေးအောင်အေးအောင်အောင်အောင်ကျော်အောင်ကျော်အောင်ကျော်အောင်ကျော်အောင်ကျော်အောင်ကျော်ကျော်အောင်ကျော်ခိုင်အောင်ကျော်စိန်အောင်ကျော်စိုးအောင်ကျော်ဇောအောင်ကျော်ညွန့်အောင်ကျော်ညွန့်အောင်ကျော်ထွီးအောင်ကျော်နိုင်အောင်ကျော်နိုင်အောင်ကျော်မြင့်အောင်ကျော်မြင့်အောင်ကျော်မြိုင်အောင်ကျော်မိုးအောင်ကျော်မိုးအောင်ကျော်လင်းအောင်ကျော်လွင်အောင်ကျော်ဝင်းအောင်ကျော်သန်းအောင်ကျော်သိန်းအောင်ကျော်သူအောင်ကြည်အောင်ကြည်အောင်ကြည်အောင်ကြည်မြိုင်အောင်ကြည်သိန်းအောင်ကြိုင်အောင်ကိုအောင်ကိုကိုအောင်ကိုကိုအောင်ကိုကိုအောင်ကိုကိုမျိုးအောင်ကိုမင်းအောင်ကိုမင်းအောင်ခင်းအောင်ချစ်ခိုင်အောင်ချမ်းငြိမ်းအောင်ချမ်းမင်းအောင်ချိန်အောင်ခိုင်အောင်ခိုင်ဇော်အောင်ငြိမ်းအောင်ငြိမ်းအောင်စိုး(ခ)အုန်းလွင်အောင်စိုးနိုင်အောင်စိုးလင်းအောင်ဆန်းအောင်ဆန်းအောင်ဆန်းအောင်ဆန်းမြင့်အောင်ဆန်းဝင်းအောင်ဆန်းဝင်းအောင်ဆန်းဝင်းအောင်ဆန်းဝေအောင်ဇာနည်စိုးအောင်ဇေယျအောင်ဇေယျအောင်ဇော်အောင်ဇော်ထက်အောင်ဇော်ထက်အောင်ဇော်နိုင်အောင်ဇော်လွင်အောင်ဇော်လှိုင်အောင်ညွန့်အောင်ဌေးအောင်ဌေးကျော်အောင်တင်အောင်တင့်အောင်တင့်အောင်ထွဏ်းအောင်ထွန်းကြည်အောင်ထွေးအောင်ထူးအောင်ဒေါင်းအောင်နိုင်အောင်နိုင်အောင်နိုင်အောင်နိုင်အောင်နိုင်အောင်နိုင်အောင်နိုင်အောင်နိုင်အောင်နိုင်အောင်နိုင်အောင်နိုင်အောင်နိုင်အောင်နိုင်အောင်နိုင်အောင်နိုင်အောင်နိုင်အောင်နိုင်အောင်နိုင်ထွန်းအောင်နိုင်ထွန်းအောင်နိုင်မိုးအောင်နိုင်လင်းအောင်နိုင်လင်းအောင်နိုင်ဝင်းအောင်နိုင်ဝင်းအောင်ဖြိုးကျော်အောင်ဖြိုးကိုအောင်ဘုန်းကျော်စံအောင်မင်းအောင်မင်းနိုင်အောင်မင်းမင်းအောင်မင်းသိဏ်းအောင်မျိုးအောင်မျိုးအောင်မျိုးအောင်မျိုးအောင်မျိုးအောင်မျိုးညွန့်အောင်မျိုးနိုင်အောင်မြကျော်အောင်မြင့်အောင်မြင့်အောင်မြင့်အောင်မြင့်အောင်မြင့်အောင်မြင့်အောင်မြင့်အောင်မြင့်ကျော်အောင်မြင့်ခိုင်အောင်မြင့်တင်အောင်မြင့်ဗိုလ်အောင်မြတ်ကျော်အောင်မြတ်သူအောင်မြိုင်အောင်မြိုင်အောင်မိန်အောင်မိုးအောင်မိုးအောင်မိုးအောင်မေရီအောင်မောင်းအောင်မောင်းအောင်ရွှေအောင်ရွှေအောင်ရွှေအောင်ရွှေအောင်ရွှေအောင်ရဲထူးအောင်လင်းအောင်လင်းအောင်လွင်အောင်လွင်အောင်လှအောင်လှသံအောင်လှိုင်အောင်လှိုင်ဝင်းအောင်လှိုင်သန်းအောင်လူအောင်ဝင်းအောင်ဝင်းအောင်ဝင်းအောင်ဝင်းအောင်ဝင်းအောင်ဝင်းကြည်အောင်ဝင်းဆွေအောင်ဝင်းတင်အောင်ဝင်းလှိုင်(ခ)အညာသားအောင်သက်အောင်သင်း(ခ)ဇော်သင်းအောင်သန်းအောင်သန်းအောင်သန်းအောင်သန်းအောင်သန်းအောင်သန်းအောင်သန်း